(798, 'Je nové kolo Mathieua van der Poela to nejhezčí v pelotonu?', '2025-03-12 20:48:00', 1, 'NÁHLEĎÁÁČEK 1920X1080(155).png', '<b style=\"mso-bidi-font-weight:normal\">Pokud jste letos\r\nsledovali alespoň jednu z etap Tirrena Adriatica, tak jste si nemohli\r\nnevšimnout jednoho kola, které svým designem vyčnívalo nad ostatní. Nizozemec\r\nMathieu van der Poel se na italských cestách představil na zbrusu novém designu\r\nkola Canyon Aerod CFR, který mu nadesignovala italská umělkyně Elena\r\nSalmistraro.</b>\r\n\r\n<p class=\"MsoNormal\">Německá firma <b style=\"mso-bidi-font-weight:normal\">Canyon\r\nnedávno zahájila možnost výběru vlastního designu u jejich kol</b>. U této\r\npříležitosti společnost najmula italskou umělkyni Elenu Salmistraro, která\r\nnavrhla design rámu s názvem Opus. Společnost Canyon se následně rozhodla, že\r\njako první <b style=\"mso-bidi-font-weight:normal\">ukáže toto kolo světu jejich\r\nnejvětší hvězda Mathieu van der Poel.</b></p><p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\"><img src=\"data:image/webp;base64,\" alt=\"\"></b></p>\r\n\r\n<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\">Model Canyon Aeroad\r\nCFR jsme si ve verzi Opus</b> mohli v akci poprvé prohlédnout v úterý 11.\r\nbřezna ve druhé etapě Tirrena Adriatica (1. etapa byla časovka). Na první\r\npohled se <b style=\"mso-bidi-font-weight:normal\">jedná o extrémně barevné kolo,\r\nna kterém převažuje světle růžová a modrá barva</b>. Do této barevné kombinace zasahuje ještě několik dalších výrvýrazných prvků.</p><p class=\"MsoNormal\"><img src=\"data:image/webp;base64,\" alt=\"\"></p>\r\n\r\n<p class=\"MsoNormal\">J<b style=\"mso-bidi-font-weight:normal\">ednotlivé prvky na\r\nkole by měly znázorňovat to, jak se autorka vžívá do jízdy na kole. </b>Tenké\r\nvlnky znamenají proudění větru, který při jízdě kolo obtéká. Italská umělkyně\r\npovažuje cyklistiku za rozmanitý sport, proto se rozhodla <b style=\"mso-bidi-font-weight:\r\nnormal\">využít tak pestrou paletu barev</b>.</p><p class=\"MsoNormal\"><img src=\"data:image/webp;base64,\" alt=\"\"></p>\r\n\r\n<p class=\"MsoNormal\">Tento design kola by dle Canyonu měl <b style=\"mso-bidi-font-weight:\r\nnormal\">být perfektní kombinací zábavy a moderního pokroku</b>. To by ve\r\nvýsledku mělo vést k tomu, že by toto kolo mělo přilákat co nejvíce pozornosti.\r\nKrom rámu se ale jedná <b style=\"mso-bidi-font-weight:normal\">o standardně\r\nnejlepší osazení</b> (v profesionálním pelotonu), které je aktuálně na trhu.&nbsp;</p><p class=\"MsoNormal\"><img src=\"data:image/webp;base64,\" alt=\"\"></p><p class=\"MsoNormal\"><b>Bližší specifikace Nizozemcova kola si můžete projít níže:</b></p>\r\n\r\n<ul><li class=\"MsoNormal\"><span style=\"mso-spacerun:yes\">&nbsp;&nbsp;&nbsp; </span>Rám: Aeroad CFR\r\n2025</li><li>\r\n\r\n<span style=\"mso-spacerun:yes\">&nbsp;&nbsp;&nbsp; </span>Sedlovka: Canyon\r\nSP0077</li><li>\r\n\r\n<span style=\"mso-spacerun:yes\">&nbsp;&nbsp;&nbsp; </span>Pohon: Shimano\r\nDura-Ace Di2 (kliky 172,5 mm)</li><li>\r\n\r\n<span style=\"mso-spacerun:yes\">&nbsp;&nbsp;&nbsp; </span>Brzdy: Shimano\r\nDura-Ace 9270 </li><li>\r\n\r\n<span style=\"mso-spacerun:yes\">&nbsp;&nbsp;&nbsp; </span>Převodník: 54/40\r\nzubů</li><li>\r\n\r\n<span style=\"mso-spacerun:yes\">&nbsp;&nbsp;&nbsp; </span>Kazeta: 11-34 zubů</li><li>\r\n\r\n<span style=\"mso-spacerun:yes\">&nbsp;&nbsp;&nbsp; </span>Kola: Shimano\r\nDura-Ace C50</li><li>\r\n\r\n<span style=\"mso-spacerun:yes\">&nbsp;&nbsp;&nbsp; </span>Pláště: P-Zero\r\nRace TLR</li><li>\r\n\r\n<span style=\"mso-spacerun:yes\">&nbsp;&nbsp;&nbsp; </span>Řídítka: Canyon\r\nPACE 42mm 120mm</li><li>\r\n\r\n<span style=\"mso-spacerun:yes\">&nbsp;&nbsp;&nbsp; </span>Sedlo: Selle\r\nItalia Flite přímo pro MVDP</li><li>\r\n\r\n<span style=\"mso-spacerun:yes\">&nbsp;&nbsp;&nbsp; </span>Cyklopočítač: Wahoo\r\nElemnt Bolt</li></ul>\r\n\r\n<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\">Líbí se Vám nový\r\ndesign van der Poelova kola?</b></p><p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\"><br></b></p><p class=\"MsoNormal\">zdroj obrázků:</p><p class=\"MsoNormal\">bikeradar.com</p>\r\n\r\n<div><br></div>    ', 6, 'je-nove-kolo-mathieua-van-der-poela-to-nejhezci-v-pelotonu');
