rity=\"49\" Name=\"List Table 4 Accent 5\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"50\" Name=\"List Table 5 Dark Accent 5\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"51\"\r\n   Name=\"List Table 6 Colorful Accent 5\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"52\"\r\n   Name=\"List Table 7 Colorful Accent 5\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"46\"\r\n   Name=\"List Table 1 Light Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"47\" Name=\"List Table 2 Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"48\" Name=\"List Table 3 Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"49\" Name=\"List Table 4 Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"50\" Name=\"List Table 5 Dark Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"51\"\r\n   Name=\"List Table 6 Colorful Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"52\"\r\n   Name=\"List Table 7 Colorful Accent 6\"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!--[if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:\"Normální tabulka\";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-parent:\"\";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:8.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:107%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:\"Calibri\",sans-serif;\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:\"Times New Roman\";\r\n	mso-bidi-theme-font:minor-bidi;\r\n	mso-fareast-language:EN-US;}\r\n</style>\r\n<![endif]-->\r\n\r\n<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\">Letošní ročník\r\nfrancouzského závodu Paris Nice dnes pokračoval pátou etapou. Ta měla klasikářský\r\ncharakter s extrémně prudkým kopcem na závěr. Nakonec jsme se dočkali bitvy\r\nfavoritů na celkové pořadí, z nichž předvedl nejvýbušnější nástup Francouz\r\nLenny Martinez, což mu vyneslo etapové prvenství. V závěrečném stoupání se mezi\r\nnejlepšími nepohyboval Jonas Vingegaard, který kvůli pádu nepředvedl svůj\r\nobvyklý výkon. Díky tomu se do celkového vedení závodu opět vrátil Američan\r\nJorgenson.</b></p>\r\n\r\n<p class=\"MsoNormal\">Pátá etapa Paris Nice zavedla závodníky z Francouzského\r\nstředohoří směrem na jihovýchod. Na trase o <b style=\"mso-bidi-font-weight:\r\nnormal\">délce 203km jezdci z jihu objeli město Lyon</b>. V druhé části trasy\r\norganizátoři přichystali několik krátkých, ale velmi prudkých kopců. <b style=\"mso-bidi-font-weight:normal\">Na jednom z nich také etapa končila</b>.</p><p class=\"MsoNormal\"><img src=\"data:image/jpeg;base64,\" alt=\"\"></p>\r\n\r\n<p class=\"MsoNormal\">Zpočátku dne se na čele vytvořil silný únik, v němž\r\nfiguroval např. Michael Matthews, Mauro Schid nebo Anthony Turgis. <b style=\"mso-bidi-font-weight:normal\">To se ale několika týmům v pelotonu\r\nnelíbilo</b>, tudíž uprchlíci nedostali příležitost se od pelotonu vzdálit. To\r\nse až na metě <b style=\"mso-bidi-font-weight:normal\">130km před cílem povedlo\r\ndvojici Thibaud Gruel a Ben Swift.</b></p>\r\n\r\n<p class=\"MsoNormal\">Takto malý únik nikomu nepřekážel a zároveň <b style=\"mso-bidi-font-weight:normal\">nepředstavoval žádné velké nebezpečí pro\r\ntýmy, jež pomýšlely na etapové vítězství</b>. Etapa následně probíhala\r\npoklidně. To se ale změnilo asi 80km před cílem, když <b style=\"mso-bidi-font-weight:\r\nnormal\">skončil na zemi Jonas Vingegaard</b>. Dánský cyklista se sice zvedl a v\r\nzávodě pokračoval, ale evidentně nebyl v pořádku.</p><p class=\"MsoNormal\"><img src=\"data:image/webp;base64,\" alt=\"\"></p>\r\n\r\n<p class=\"MsoNormal\">Peloton i po pádu lídra závodu nadále kontroloval náskok\r\nuprchlíků. Asi 45 km před dojezdem z <b style=\"mso-bidi-font-weight:normal\">hlavní\r\nskupiny odjel Tobias Foss</b>. Ten se rychle připojil k čelní dvojici, kde\r\nbyl<span style=\"mso-spacerun:yes\">&nbsp; </span>jeho týmový kolega z týmu Ineos\r\nGrenadiers - Ben Swift. Jezdci z úniku ale byli po celém dni vyčerpaní, tudíž\r\npo pár kilometrech <b style=\"mso-bidi-font-weight:normal\">už Foss pokračoval na\r\nčele závodu sám</b>.</p>\r\n\r\n<p class=\"MsoNormal\">Nor z týmu Ineos sice dlouho vzdoroval hlavnímu poli, ale <b style=\"mso-bidi-font-weight:normal\">jeho iniciativa byla zmařena pelotonem 4km\r\npřed cílem</b>. V tu chvíli se už připravovala závěrečná bitva v cílovém 1,7km\r\ndlouhém kopci. Jeho průměrný sklon činil 10 %, ale v <b style=\"mso-bidi-font-weight:\r\nnormal\">maximu toto stoupání dosahuje sklonu až 18 %!</b></p><p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:\r\nnormal\"><img src=\"data:image/jpeg;base64,\" alt=\"\"></b></p>\r\n\r\n<p class=\"MsoNormal\">Jako první z hlavních favoritů vyložil karty na stůl <b style=\"mso-bidi-font-weight:normal\">Matteo Jorgenson. Ten asi v polovině kopce\r\nrozjel tak pekelné tempo</b>, že<span style=\"mso-spacerun:yes\">&nbsp; </span>mu na\r\nzadním kole zůstali viset pouze 4 závodníci. V tu chvíli se dosavadní lídr závodu\r\nJonas <b style=\"mso-bidi-font-weight:normal\">Vingegaard trápil na konci hlavní\r\nskupiny</b>.</p>\r\n\r\n<p class=\"MsoNormal\">Šílenému tempu amerického závodníka z týmu Visma Lease a\r\nBike <b style=\"mso-bidi-font-weight:normal\">hbitě sekundoval domácí Francouz\r\nLenny Martinez</b> a taky dvojice týmu Astana XDS. Z brutálního tempa dokázal\r\nzrychlit pouze Martinez, který díky akceleraci setřásl všechny soupeře. <b style=\"mso-bidi-font-weight:normal\">Francouzský závodník týmu Bahrain Victorious\r\nsi tak připsal druhé letošní vítězství</b>.</p><p class=\"MsoNormal\"><p></p><div class=\"iframe\"><blockquote class=\"twitter-tweet\" data-media-max-width=\"560\"><p lang=\"fr\" dir=\"ltr\">💪 𝗟𝗘𝗡𝗡𝗬 𝗩𝗜𝗗𝗜 𝗩𝗜𝗖𝗜 🙌<br><br>🇫🇷 <a href=\"https://twitter.com/lennymrtz1?ref_src=twsrc%5Etfw\">@lennymrtz1</a> 👏<a href=\"https://twitter.com/hashtag/ParisNice?src=hash&amp;ref_src=twsrc%5Etfw\">#ParisNice</a> <a href=\"https://t.co/WTctZSbVyZ\">pic.twitter.com/WTctZSbVyZ</a></p>— Paris-Nice (@ParisNice) <a href=\"https://twitter.com/ParisNice/status/1900212500261409033?ref_src=twsrc%5Etfw\">March 13, 2025</a></blockquote> <script async=\"\" src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script> </div></p>\r\n\r\n<p class=\"MsoNormal\">Tým Astana XDS získal UCI body za <b style=\"mso-bidi-font-weight:\r\nnormal\">druhé místo díky Francouzi Champoussinovi</b> a kazašský tým také zaznamenal\r\nčtvrté místo zásluhou Kolumbijce Tejady. <b style=\"mso-bidi-font-weight:normal\">Třetí\r\ndo cíle dorazil Matteo Jorgenson, který se vrátil do čela celkového pořadí</b>.\r\nJonas Vingegaard ztratil 26 sekund a propadl se na průběžně druhou příčku.</p><p class=\"MsoNormal\"><img src=\"data:image/png;base64,\" alt=\"\"></p>\r\n\r\n<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\">Kdo podle Vás ovládne\r\nParis Nice?</b></p><p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\"><br></b></p><p class=\"MsoNormal\">zdroje:</p><p class=\"MsoNormal\">procyclingstats.com</p><p class=\"MsoNormal\">facebook.com/highlightsofcycling</p>\r\n\r\n', 6, 'pad-vingegaarda-triumf-lennyho-martineze-a-jorgensonuv-navrat-do-zluteho-dresu-to-vse-prinesla-pata-etapa-paris-nice');
INSERT INTO `clanky` (`id`, `nazev`, `datum`, `viditelnost`, `nahled_foto`, `obsah`, `user_id`, `url`) VALUES
(800, 'PÁTEČNÍ PĚTKA: Top 5 produktů tohoto týdne (14.3. - 21.3. 2025)', '2025-03-14 11:02:00', 1, 'Copy of SuperDeal - web (7).png', '\r\n        \r\n        Jaro je tu a <b>kolotoč závodů</b> se nám co nevidět rozjede. Proto by si <b>nejen závodníci</b>, ale i všichni ostatí, měli pořídit nějaký <b>pořádný nový kousek</b> do své výbavy, aby je v seźoně<b> nic nezaskočilo</b>. A aby to bylo za co nejnižší cenu, jsme tu my s<b> Páteční pětkou! </b>Jdeme na to!<div><br></div><h2>1) Brýle&nbsp;EKOI PERSOEVO8</h2><div><br></div><div>Je libo brýle, které jsou výbavou <b>profi cyklistů </b>ve WorldTour pelotonu? To jsou&nbsp;<b>EKOI PERSOEVO8</b>, které nyní seženete za za poloviční cenu - <b>1 009 Kč</b>. Zorník je kategorie <b>3</b> a proti zamlžení je v něm <b>5 otvorů</b>. Jejich hmotnost je jenom <b>31 g</b>. V poměru<b> cena/výkon</b> neseženete moc lepších věcí. Koupíte&nbsp;<a href=\"https://www.ekoi.cz/cs/cyklisticke-slunecni-bryle/13216-lunettes-ekoi-persoevo8-blanc-revo-rouge-cat3.html\" target=\"_blank\"><b>ZDE</b></a>.</div><div><br></div><div><img src=\"https://www.magazin.cyklistickey.cz/assets/img/upload/clanek_obsah/67d405593ab70-lunettes-ekoi-persoevo8-blanc-revo-rouge-cat3.webp\" alt=\"\"><em></em><br><h2>2) Magene C406 PRO</h2></div><div><br></div><div>Potřebujete<b> levný ale dostačující cyklopočítač? </b>Potom by jste se mohli zaměřit na <b>Magene C406 PRO</b>. Disponuje <b>2,5 palcovým displejem</b> a zvládne <b>28 hodin provozu</b>. Kompatibilní je se všemi základními druhy senzorů včetně radaru a voděodolnost je rovněž samozřejmostí. Na to všechno je cena<b>&nbsp;2 199 Kč</b> fakt fajn co? Koupíte&nbsp;<a href=\"https://www.cycli.cz/cyklocomputer/41018-magene-c406-pro-6971606840960.html\" target=\"_blank\"><b>ZDE</b></a>.</div><div><br></div><div><img src=\"https://www.magazin.cyklistickey.cz/assets/img/upload/clanek_obsah/67d488933876e-magene-c406-pro.jpg\" alt=\"\"><em></em><br><h2>3) Střed Shimano Ultegra&nbsp;6800 SM-BBR60</h2></div><div><br></div><div>Každej máme na kole <b>střed</b>, a ti, kteří mají <b>šroubovanou variantu</b>, mohou nyní zbystřet. Máme tu totiž jeden za moc fajn cenu. Střed se dá zahrnout do <b>spotřebního materiálu,</b> a proto je vhodné ho za<b> 379 Kč</b> objednat do zásoby. Koupíte&nbsp;<a href=\"https://www.kupkolo.cz/stredova-osa-shimano-ultegra-6800-sm-bbr60_z95309/#1700463\" target=\"_blank\"><b>ZDE</b></a>.</div><div><br></div><div><img src=\"https://www.magazin.cyklistickey.cz/assets/img/upload/clanek_obsah/67d48a4c99b7b-facebook-image (1).png\" alt=\"\"><em></em><br><h2>4) Plášť Schwalbe Racing Ralph</h2></div><div><br></div><div>Parádní cross-country plášť poskytuje<b> velmi rychlý a dobře odvalující profil.</b>&nbsp;Uzpůsobený je pro použití na <b>zadní kolo</b>. Vyroben je pak ze směsi <b>Addix Performance</b>. Je to velmi univerzální směs, použitelná<b> na všech površích</b>. Poskytuje vysokou odolnost proti <b>proražení, nebo proříznutí</b>. Plášť je dostupný ve velikosti<b> 29x2,25 a 29x2,35</b>. Samozřejmostí je <b>bezdušové použití a kevlarová patka</b>. Cena je krásných <b>599 Kč</b>. Koupíte&nbsp;<a href=\"https://www.kupkolo.cz/29-schwalbe-racing-ralph-addix-performance-tl-ready_z105261/#1778362\" target=\"_blank\"><b>ZDE</b></a>.</div><div><br></div><div><img src=\"https://www.magazin.cyklistickey.cz/assets/img/upload/clanek_obsah/67d48d1a6119f-schwalbe-racing-ralph-new-addix-performance-tlr-29x2-25_v.jpg\" alt=\"\"><em></em><br><h2>5) Řetěz Shimano XTR 12s</h2></div><div><br></div><div>Nejvyšší řada řetězu <b>pod tisícovku?</b> Vemte si moje prachy! Řetěz typický svými<b> dutými čepy</b> a výrazně vyšší výdrží oproti nižším variantám je nyní dostupný za<b> 947 Kč</b>. To je neodolatelná nabídka pro každého majitele <b>12 rychlostní Shimano sady</b>. Řetěz do zásoby se vám doma určitě <b>neztratí</b>. Koupíte&nbsp;<a href=\"https://www.hupnakolo.cz/shimano-xtr-cn-m9100/\" target=\"_blank\"><b>ZDE</b></a>.</div><div><br></div><div><img src=\"https://www.magazin.cyklistickey.cz/assets/img/upload/clanek_obsah/67d48e1b2bdce-685775_retez-shimano-xtr-cn-m9100-12kolo-116cl.webp\" alt=\"\"><em></em><br><b>Tak, a je to všechno! Znovu tu budeme už příští týden s nejlepšími slevami v internetových vodách!</b></div>        ', 4, 'patecni-petka-top-5-produktu-tohoto-tydne-143---213-2025'),
