la ke<span style=\"mso-spacerun:yes\">&nbsp; </span>konci. Na závěr své poslední sezóny se mu na\r\nmistrovství světa v&nbsp;Glasgow povedlo vybojovat titul mistra světa\r\nv&nbsp;cross-country maratonu. Všichni si tehdy mysleli, že to bude Brazilcův\r\nposlední úspěch v&nbsp;profesionální kariéře. V&nbsp;roce 2024 se dal Avancini\r\npauzu, ale na začátku letošního oznámil obrovskou novinu. V&nbsp;roce 2025 bude\r\nBrazilec závodit za nově vzniklý silniční tým Factor Racing.</b></p>\r\n\r\n<p class=\"MsoNormal\">Nový projekt <b style=\"mso-bidi-font-weight:normal\">Facor Racing\r\nvznikl spoluprací slovinského týmu</b>, který vychovává závodníky do 23 let a britské\r\nznačky kol Factor. Sídlo nově vzniklého týmu se nachází ve slovinské Kranji<b style=\"mso-bidi-font-weight:normal\">. Dříve se tento tým specializoval pouze na\r\ndomácí závodníky do 23 let</b>, což se s&nbsp;příchodem nových sponzorů změnilo.</p><p class=\"MsoNormal\"><img class=\"w-full object-cover object-cover w-full h-full\" src=\"https://images.ctfassets.net/uyc32o2uod42/2EeLV6IpA9TIzgJReh9syP/60e5c10272c639629534cfd6aeabb687/blog-factor-racing-Henrique-002.jpg\"></p>\r\n\r\n<p class=\"MsoNormal\">Pro sezónu 2025 do týmu přišlo hned několik nových jmen.\r\nJednoznačně <b style=\"mso-bidi-font-weight:normal\">největším mediálním</b> <b style=\"mso-bidi-font-weight:normal\">lákadlem je brazilský cyklista Henrique\r\nAvancini.</b> Spolu s&nbsp;ním tento kontinentální tým posílil novozélandský\r\nmistr Paul Wright. Zbytek týmu tvoří nadějní závodníci z&nbsp;původního slovinského\r\ntýmu. Jedinou výjimku <b style=\"mso-bidi-font-weight:normal\">tvoří Adam Bradáč,\r\nkterý před sezónou přišel z&nbsp;juniorského týmu Dukly Praha</b>.</p><p class=\"MsoNormal\"><img class=\"w-full object-cover object-cover w-full h-full\" src=\"https://images.ctfassets.net/uyc32o2uod42/lJiXyhp4xLQIM1jUNkNTr/eaf865c07e8f6dac41db926b59f4f070/blog-factor-racing-Henrique-011.jpg\"></p>\r\n\r\n<p class=\"MsoNormal\">Jméno týmu Facror Racing už jsme letos mohli zahlédnout v&nbsp;několika\r\nvýsledkových listinách. Prozatím <b style=\"mso-bidi-font-weight:normal\">největší\r\núspěch tento slovinský tým zaznamenal díky Paulu Wrightovi</b>, který z&nbsp;kraje\r\nroku ovládl mistrovství Nového Zélandu. Ten samý závodník zaznamenal i třetí místo\r\nna chorvatské Poreč Classic. <b style=\"mso-bidi-font-weight:normal\">Avancini v&nbsp;Chorvatsku\r\nobsadil 20. příčku</b>.</p><p class=\"MsoNormal\"><img class=\"w-full object-cover object-cover w-full h-full\" src=\"https://images.ctfassets.net/uyc32o2uod42/5UubNTLo8xbbeVGw7hBKkE/a95845df2390de4bebd57ffc6f0d822e/blog-factor-racing-Henrique-016.jpg\"></p>\r\n\r\n<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\">Co říkáte na\r\nBrazilcovo rozhodnutí?</b></p>\r\n\r\n', 6, 'brazilsky-bajker-avancini-po-roce-pauze-restartuje-karieru-v-silnicnim-tymu-factor-racing');
